	public static void submitImage(String choice) {
		Image image = Base64EncoderStatic.DecryptPicture(choice);
		Image image2 = Base64EncoderStatic.DecryptPicture(choice);
		image = image.getScaledInstance(mainRunnerCore.weatherIcon.getWidth(), mainRunnerCore.weatherIcon.getHeight(), Image.SCALE_SMOOTH);
		image2 = image2.getScaledInstance(mainRunnerCore.weatherM.getWidth(), mainRunnerCore.weatherM.getHeight(), Image.SCALE_SMOOTH);
		ImageIcon icon = new ImageIcon(image);
		ImageIcon icon2 = new ImageIcon(image2);
		mainRunnerCore.weatherIcon.setIcon(icon);
		mainRunnerCore.weatherM.setIcon(icon2);

	}
	
